SELECT ?gangster ?gangsterLabel ?period WHERE {
    ?gangster dct:subject dbc:Prohibition-era_gangsters. 
    ?gangster rdfs:label ?gangsterLabel.
    FILTER (lang(?gangsterLabel) = 'en')
    OPTIONAL {
        ?gangster dbo:activeYearsStartYear ?activeYearsStartYear.
        ?gangster dbo:activeYearsEndYear ?activeYearsEndYear.
        BIND(CONCAT(STR(?activeYearsStartYear), "-", STR(?activeYearsEndYear)) AS ?period)
    }
}

